import React from 'react'
import Form from '../Components/Form'

const Contact = () => {
  return (
    <div className='contacto'>
      <h2>¿Quieres saber más?</h2>
      <p>Envíanos tus preguntas y te contactaremos.</p>
      <Form/>
    </div>
  )
}

export default Contact
